import React from 'react';

function ImagePopup({ onClose, isOpen, card }) {
  return (
    <div className={`popup popup_type_picture ${isOpen ? 'popup_opened' : false}`}>
      <div className={`popup__container popup__container_type_picture`}>
        <button onClick={onClose} className="popup__close" type="button"></button>
        <img className="popup__image" src={card.link} alt="Картинка" />
        <h2 className="popup__title popup__title_type_picture">{card.name}</h2>
      </div>
    </div>
  );
}

export default ImagePopup;
